import { Suspense, lazy } from 'react';
import './App.css';
import {
  createRoutesFromElements,
  RouterProvider,
  Route,
  createBrowserRouter,
  Navigate,
} from 'react-router-dom';
import { routes } from './routes/routes';
const ErrorComponent = lazy(import('./components/common/ErrorComponent'));
import SuspenseLoader from './components/common/SuspenseLoader';

const router = createBrowserRouter(
  createRoutesFromElements(
    <Route>
      <Route
        path={routes.main.path}
        element={<Navigate to={`${routes.main.path}/inbox`} />}
      />

      <Route path={routes.main.path} element={<routes.main.element />}>
        <Route
          path={`${routes.main.path}/:type`}
          element={<routes.main.element />}
          errorElement={<ErrorComponent />}
        />
        <Route
          path={routes.view.path}
          element={<routes.view.element />}
          errorElement={<ErrorComponent />}
        />
      </Route>

      <Route
        path={routes.invalid.path}
        element={<Navigate to={`${routes.emails.path}/inbox`} />}
      />
    </Route>
  )
);

function App() {
  return (
    <Suspense fallback={<SuspenseLoader />}>
      <RouterProvider router={router} />
    </Suspense>
  );
}

export default App;
